-- ***********************************************************
--  Übungsdatenbank Vereinsverwaltung
--  Erweitert die Datenbank mit 500 Spenden
-- ***********************************************************
-- Während der Durchführung treten PK-Verstosse auf
-- Im Schema von Vereinuser
ALTER SESSION SET CURRENT_SCHEMA = vereinuser;


UPDATE sponsor s1 SET spendentotal = (SELECT SUM(betrag) FROM spende s2 WHERE s2.sponid = s1.sponid)
WHERE s1.sponid > 99 AND (SELECT SUM(betrag) FROM spende s2 WHERE s2.sponid = s1.sponid) > 0;

COMMIT;
ALTER SESSION SET CURRENT_SCHEMA = sys;